import React from "react";

import {Routes, Route} from "react-router";


import { configureStore }
  from '@reduxjs/toolkit';
import {Provider, useSelector} from "react-redux";
import usersReducer from "./reducers/users-reducer";
import Profile from "./profile";
import Explore from "./explore";
import Search from "./search";
import {BrowserRouter} from "react-router-dom";
import Navigation from "./navigation";
import ProfileSideComponent from "./profile";


const store = configureStore({
  reducer: {userData: usersReducer}});


function ReadIt() {
    const {currentUser} = useSelector(state => state.userData)
  return (
        <BrowserRouter>
          <Provider store={store}>
              <div className="row">
                <Navigation/>
              </div>
            <div className="m-4 row">
              <div className="col-2">
                <Routes>
                    <Route index path="/*" element={<ProfileSideComponent user={currentUser}/>}/>
                    <Route path="/view-profile" element={<Explore/>}/>
                </Routes>
              </div>
              <div className="col-7">
                  <Routes>
                      <Route index path="/*" element={<Explore/>}/>
                  </Routes>
              </div>
              <div className="col-3">
                Trending
              </div>
            </div>
          </Provider>
        </BrowserRouter>


  );

}

export default ReadIt
